import { useState } from 'react';
import { Image, Layers, Package, Zap, Globe } from 'lucide-react';
import './B.css';

function App() {
  const [activeTab, setActiveTab] = useState(1);

  const tabsData = [
    {
      id: 1,
      name: 'Tab 1',
      items: [
        { title: 'Mountain Peak', description: 'Experience breathtaking views from the summit' },
        { title: 'Ocean Waves', description: 'Relax by the serene coastal waters' },
        { title: 'Forest Trail', description: 'Discover hidden paths through lush greenery' },
        { title: 'Desert Dunes', description: 'Explore vast golden sand landscapes' },
        { title: 'City Lights', description: 'Marvel at the urban nighttime glow' },
        { title: 'Northern Aurora', description: 'Witness nature\'s most spectacular light show' },
        { title: 'Valley Vista', description: 'Panoramic views of rolling hills' },
        { title: 'Waterfall Wonder', description: 'Feel the power of cascading water' },
        { title: 'Canyon Depths', description: 'Journey through ancient rock formations' },
        { title: 'Sunset Beach', description: 'Golden hour at the shoreline' },
        { title: 'Alpine Meadow', description: 'Wildflowers blanket mountain slopes' },
        { title: 'Glacier Ice', description: 'Ancient frozen rivers of time' }
      ]
    },
    {
      id: 2,
      name: 'Tab 2',
      items: [
        { title: 'Tech Innovation', description: 'Cutting-edge solutions for tomorrow' },
        { title: 'Digital Design', description: 'Beautiful interfaces that inspire' },
        { title: 'Cloud Systems', description: 'Scalable infrastructure solutions' },
        { title: 'Data Analytics', description: 'Insights that drive decisions' },
        { title: 'AI Solutions', description: 'Intelligence meets automation' },
        { title: 'Blockchain Tech', description: 'Decentralized future networks' },
        { title: 'IoT Devices', description: 'Connected smart ecosystems' },
        { title: 'Cyber Security', description: 'Protection for digital assets' },
        { title: 'Mobile Apps', description: 'Apps that users love' },
        { title: 'Web Platforms', description: 'Robust online experiences' },
        { title: 'API Services', description: 'Seamless integrations' },
        { title: 'DevOps Tools', description: 'Streamlined development workflows' }
      ]
    },
    {
      id: 3,
      name: 'Tab 3',
      items: [
        { title: 'Creative Studio', description: 'Where imagination comes to life' },
        { title: 'Brand Identity', description: 'Memorable visual storytelling' },
        { title: 'Content Creation', description: 'Engaging media production' },
        { title: 'Marketing Strategy', description: 'Growth-driven campaigns' },
        { title: 'Social Media', description: 'Build your online presence' },
        { title: 'Video Production', description: 'Cinematic quality content' },
        { title: 'Photography', description: 'Capturing perfect moments' },
        { title: 'Graphic Design', description: 'Visual communication excellence' },
        { title: 'Copywriting', description: 'Words that convert' },
        { title: 'SEO Optimization', description: 'Rank higher, reach more' },
        { title: 'Email Marketing', description: 'Direct customer engagement' },
        { title: 'Analytics Reports', description: 'Measure what matters' }
      ]
    },
    {
      id: 4,
      name: 'Tab 4',
      items: [
        { title: 'Business Growth', description: 'Scale your enterprise effectively' },
        { title: 'Team Building', description: 'Cultivate high-performing teams' },
        { title: 'Project Management', description: 'Deliver on time, every time' },
        { title: 'Financial Planning', description: 'Strategic resource allocation' },
        { title: 'Customer Success', description: 'Build lasting relationships' },
        { title: 'Sales Pipeline', description: 'Convert leads to revenue' },
        { title: 'Product Launch', description: 'Market entry excellence' },
        { title: 'Operations', description: 'Efficient process optimization' },
        { title: 'HR Solutions', description: 'People-first practices' },
        { title: 'Legal Compliance', description: 'Stay protected and informed' },
        { title: 'Training Programs', description: 'Invest in your workforce' },
        { title: 'Consulting', description: 'Expert guidance for success' }
      ]
    },
    {
      id: 5,
      name: 'Tab 5',
      items: [
        { title: 'Health Wellness', description: 'Mind and body harmony' },
        { title: 'Nutrition Guide', description: 'Fuel your best performance' },
        { title: 'Fitness Training', description: 'Achieve your physical goals' },
        { title: 'Mental Health', description: 'Balance and peace of mind' },
        { title: 'Yoga Practice', description: 'Flexibility and strength' },
        { title: 'Meditation', description: 'Find your inner calm' },
        { title: 'Sleep Quality', description: 'Restorative rest solutions' },
        { title: 'Lifestyle Coach', description: 'Personalized wellness plans' },
        { title: 'Stress Relief', description: 'Techniques for relaxation' },
        { title: 'Energy Boost', description: 'Natural vitality enhancement' },
        { title: 'Healthy Habits', description: 'Build sustainable routines' },
        { title: 'Holistic Care', description: 'Complete wellness approach' }
      ]
    }
  ];

  const getIcon = (index: number) => {
    const icons = [Image, Layers, Package, Zap, Globe];
    const Icon = icons[index % icons.length];
    return <Icon className="tab-icon" />;
  };

  const currentTabData = tabsData.find(tab => tab.id === activeTab);

  return (
    <div className="app-container">
      <div className="tabs-wrapper">
        <div className="tabs-header">
          {tabsData.map(tab => (
            <button
              key={tab.id}
              className={`tab-button ${activeTab === tab.id ? 'active' : ''}`}
              onClick={() => setActiveTab(tab.id)}
            >
              {tab.name}
            </button>
          ))}
        </div>

        <div className="tabs-content">
          <div className="grid-container">
            {currentTabData?.items.map((item, index) => (
              <div key={index} className="grid-item">
                <div className="item-image">
                  {getIcon(index)}
                </div>
                <h3 className="item-title">{item.title}</h3>
                <p className="item-description">{item.description}</p>
              </div>
            ))}
          </div>
        </div>
      </div>
    </div>
  );
}

export default App;
